// Navigation component
import React from 'react';
import { Outlet, Link } from 'react-router-dom';
import Home from "./"
function Layout() {
  return (
    <>
    <nav>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/AboutUs">About Us</Link>
        </li>
        <li>
          <Link to="/ContactUS">Contact Us</Link>
        </li>
      </ul>
    </nav>
    <Outlet/>
  </>
  );
}



export default Layout;
